Module declaration to allow import syntax like:

import { autoMockOff } from "jest";
import \* as Jest from "jest";

Bundled [here](https://github.com/brunolm/LinqSharp/blob/master/linqsharp.d.ts).

@brunolm, you might also want to include `"types"` in your `package.json` so the types are automatically picked up by the compiler. See the [handbook](http://www.typescriptlang.org/docs/handbook/declaration-files/publishing.html).

Also, a definition file doesn't need header comments if it's not in DefinitelyTyped.

When using `strictNullChecks`, it detects a minor misstake that declares the actual function as optional, but truth is the parameter is optional, not the other way around.

This example fails:

``` js
describe('strictNullChecks', function () {
    it('does not complain when using done callback', (done) => {
        done(); // error is possibly undefined
    })
});
```

I can revert `strictNullChecks` if you want to but it's very useful to find bugs like these.

**Improvement to existing type definition.**

In addtition to PR : https://github.com/DefinitelyTyped/DefinitelyTyped/pull/10966, the following changes are done:
0] Added link (http://docs.aws.amazon.com/lambda/latest/dg/nodejs-prog-model-using-old-runtime.html#nodejs-prog-model-oldruntime-context-methods) also to the text Functions for compatibility with earlier Node.js Runtime v0.10.42

1] Remove log(message: string, object: any): void;

2] Add done(error: Error, result?: any): void;

3] Add other fail: fail(error: Error): void;

4] Updated unit-tests

